import React from "react";
import uuid from "uuid/v1";

export default function OldComments({ comments }) {
  const oldComments = comments.map(comment => {
    return (
      <div id={comment.uuid()}className="comment-card">
        <div className="comment-card__avatar"></div>
        <div className="comment-card__body">
          <div className="comment-card__body--top">
            <span className="comment-card__body--top--username">{comment.name}</span>
            <span className="comment-card__body--top--date">{comment.timestamp}</span>
          </div>
          <span className="comment-card__body--text">{comment.commentText}
          </span>
        </div>
      </div>
    );
  });
  return <div></div>;
}
